    if mibBuilder.loadTexts: netiItsMIB.setRevisionsDescriptions(('- Added object for setting maximum expected differential delay on 1+1 protected transport, itsIfPs3MaxExpDifferentialDelay. - Added setting to freeze output: freeze(3) to object itsIfTxMuteOnFault.', '- Objects for managing SDI timing delay has been changed: itsIfSdiFsVDelay and itsIfSdiFsHDelay have been obsoleted, and are replaced with itsIfSdiFsDealy. - Added object for controlling audio transport on JPEG 2000 enabled interface, itsIfJ2kReduceAudioTransportBitrate.', '- Added objects for managing SDI timing providers: itsIfSdiIsTimingProvider, itsIfSdiFsVDelay and itsIfSdiFsHDelay. Also added bits to itsIfCapabilities: fs(15), avrs(16), dvrs(25). - Updated itsIfJ2kSignalFormat. Renamed sdSdiPAL(1) to sdSdi(1), and removed sdSdiNTSC(2). There is no differentiation between PAL and NTSC.', '- Added references from interface to TTPs, itsIfMembersSrc, itsIfMembersSnk. - Added objects for protection type 3 and hitless protection, itsIfPs3Table.', '- Added table for SDI interfaces, itsIfSdiTable. This table contains objects for controlling autosense and presenting video format. - Corrected VBI index range to 1..46, itsIfSdiVbiIndex.', 'Clarified some object descriptions and the relation to JPEG 2000.', '- Added new JPEG 2000 signal formats to itsIfJ2kSignalFormat. - Added objects for presenting VBI, ANC and audio rate on JPEG 2000 capable interfaces, itsIfJ2kRateVBI, itsIfJ2kRateAnc, itsIfJ2kRateAudio. - Added audio sample size to JPEG 2000 capable interfaces, itsIfJ2kAudioSampleSize. - Added table for VBI lines for SDI interfaces, itsIfSdiVbiTable. - Added table for ANC data for SDI interfaces, itsIfSdiAncTable.', 'Extended support for JPEG 2000 interfaces, added: - Added object to set signal format, itsIfJ2kSignalFormat. - Added objects for presentation of video rate, itsIfJ2kRateVideo, itsIfJ2kRateVideoMax. - Added table to configure audio groups, itsIfSdiAudioTable.', 'This version of the MIB contains functionality that has not yet been incorporated into the MAIN branch of NimOS. This version of the MIB is a merge of: - JPEG 2000 functionality - AES (MADI) functionality.', 'Added basic support for JPEG 2000: - Added table for JPEG 2000 interfaces, itsIfJ2kTable. - Added j2kEnc(21) and j2kDec(22) to itsIfCapabilities.', 'Added table for AES interfaces, itsIfAesTable. Added madi(19) and ref(20) to itsIfCapabilities.', 'The itsIfLoopTime is deprecated.', 'Added object itsSnkTtpPSAllow to itsSnkTtpTable. Removed default value for object itsIfProperites.', 'Added object itsIfInterfaceType to itsIfTable. Added table itsIfPdhTable dedicated for PDH interface related configuration objects. Added table itsIfMonTable dedicated for monitor interface related configuration objects. Added table itsIfSdhTable dedicated for SDH interface related configuration objects. Added table itsIfDvbTable dedicated for DVB interface related configuration objects.', 'Added sdi2967(13) and sdi2970(14) to itsIfCapabilities. Updated some descriptions. Changed labels to sdi1483, sdi1485, sdi288 and sdi270 in itsIfCapabilities to conform to SMIv2 (RFC2578). Added itsSnkTtpTConnection2 for support of 1+1 protection where two connections from two different trail termination points (TTPs) are used, as opposed to two channels in the same connection from a single TTP.', 'Added ttp(5), loopl(7), loopd(8), sdi-1483(9), sdi-1485(10), sdi-288(11) and sdi-270(12) to itsIfCapabilities.', 'Added tables to lookup index for a TTP based on the DSTI: itsSrcIndexLookupTable and itsSnkIndexLookupTable.', 'Added itsIfPurpose.', 'Changed label ais(2) to warning(2) for itsIfSuppressAlarm and itsSnkTtpSuppressAlarm. Added interfacePM(4) to itsIfCapabilities. Added lod(4), rdi(5), lol(6) to itsIfDefects. Added columnar object itsIfTxMuteOnFault. Added notSupported(0) to itsIfLoopMode, itsIfSuppressAlarm and itsSnkTtpSuppressAlarm. Importing Gauge32. Corrected typos.',))
