    description = 'Describes the protection status of a protected service. unavailable(1). means that neither channel is up. unprotected(2). means that one of the channels is up. standbyProtected(3). means that both channels are up and if the active channel detects AIS, a failover will occur while incurring a hit. hitlessCapable(4). means that the differential delay is within limit, but a buffer reset is required to reach hitless protected state. This can be achieved by writing the forceHit parameter. hitlessProtected(5). means that either channel can go down without incurring a data loss.'
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5))
    namedValues = NamedValues(("unavailable", 1), ("unprotected", 2), ("standbyProtected", 3), ("hitlessCapable", 4), ("hitlessProtected", 5))

