if mibBuilder.loadTexts: itsIfCapabilities.setDescription('Capabilities of the interface. The corresponding bit is set if the capability is supported by the interface. multicast(0). It is possible to use in multicast connection. allowProtection(1). 1+1 protection on originating and terminating side is supported. requireCapacity(2). Management and setting of the connection capacity is required. This is the case for e.g. an DVB interface where the capacity may be set between 0.5 Mbps and 212.5 Mbps, but not for e.g. an SDI interface where the capacity is fixed at 270 Mbps. channelPM(3). Performance monitoring on the connection that terminates on the TTP that uses the interface is supported. interfacePM(4). Performance monitoring on the data received on the interface is supported. ttp(5). Allowed to be bound to a TTP. mon(6). Monitoring port support. loopl(7). Interface supports line loop-back. See itsIfLoopMode. loopd(8). Interface supports DTM loop-back. See itsIfLoopMode. sdi1483(9). Interface supports HD-SDI 1.485/1.001 Gbps. sdi1485(10). Interface supports HD-SDI 1.485 Gbps. sdi288(11). Interface supports 270 Mbps SD-SDI using a 288 Mbps channel. sdi270(12). Interface supports 270 Mbps SD-SDI using a 270 Mbps channel. sdi2967(13). Interface supports HD-SDI 2.970/1.001 Gbps. sdi2970(14). Interface supports HD-SDI 2.970 Gbps. fs(15). Interface supports frame synchronization. avrs(16). Interface supports analog video reference signal. madi(19). Interface supports MADI - AES10. ref(20). Interface supports interface locking. j2kEnc(21). Interface supports JPEG 2000 encoding. j2kDec(22). Interface supports JPEG 2000 decoding. hitps(23). Interface supports hitless 1+1 protection. psType3(24). Interface supports protection model where two sink trail termination points (TTP) per destination is used. dvrs(25). Interface supports digital video reference signal. compatible(31). The interface is compatible with older systems, and is able to function in a connection where the remote node is of older system release.')
